  \"2016-05-27T02:32:37.290401\",\n\t\"name\": \"critical-habitat-designations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Endangered Species Act (ESA) requires
  the Federal government to designate 'critical habitat' for any species it lists
  under the ESA. This dataset combines both the NOAA National Marine Fisheries Service
  species listed as critical habitat as well as the coastal species from US Fish &
  Wildlife Service. Critical habitat is defined as1. Specific areas within the geographical
  area occupied by the species at the time of listing, if they contain physical or
  biological features essential to conservation, and those features may require special
  management considerations or protection; and 2. Specific areas outside the geographical
  area occupied by the species if the agency determines that the area itself is essential
  for conservation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
